maze = ''

function decompress(input,f=function(i){if(i=='0'){return false}else{return true}}){
    console.log(input)
    var out = [];
    for(var i=0;i<36;i++){
        var out2 = [];
        var active = input.slice(28*i,28*(i+1));
        for(var j=0;j<28;j++){
            var active2 = active.slice(j,j+1);
            out2.push(f(active2))
        }
        out.push(out2)
    }
    return out;
}
